exec sp_cursoropen @p1 output,N'
     SELECT DISTINCT  top 250 '' ''CUSTNMBR
         , '''' AS ADRSCODE
         , '''' STATUT
         , '''' Produit,Civic
         , '''' APP
         , CASE  WHEN isnumeric(left(NomRue,1)) = 1 THEN  RTRIM(NomRue) + '' '' + RTRIM(CodeRue)
                 WHEN CodeRue =''RUE'' THEN   RTRIM(NomRue)
             ELSE   RTRIM(CodeRue) + '' '' + RTRIM(NomRue) END NomRue
         , NomMunicipalite
         , CodePostal
         , '''' PRO_NO_ID_UEF
         , CodeRue
         , ''1'' pr
         , '''' AS service_description
         , ''1900-01-01'' AS date_of_service_call
     FROM POSTECANADA..AdressePostalQuebec a WITH(NOLOCK, INDEX(Civic_NomRue_CodePostal))
  where 1=1
   and REPLACE(a.Civic, '','', '''') = ''7100 ''
   and a.NomRue like ''%JEANTALON%''
 ORDER BY NomRue',@p3 output,@p4 output,@p5 output
exec sp_cursoropen @p1 output,N'
         SELECT DISTINCT TOP 250 '' '' CUSTNMBR
             ,'''' AS ADRSCODE
             ,''''STATUT
             ,''''Produit
             , pc.CIVIC+ Pro_Suffixe1 CIVIC
             ,''''  APP
             , pro_voie_c + ISNULL(NULLIF('' '' + pro_voie_l, '' ''), '''') + ISNULL(NULLIF('' '' + PRO_VOIE, '' ''), '''')  + ISNULL(NULLIF('' '' + PRO_VOIE_O, '' ''), '''')  NomRue
             , LTRIM(RTRIM(REPLACE(MUN_NUM_MUNICIPALITE, ''(FUSION)'', ''''))) NomMunicipalite
             , PRO_POSTAL CodePostal
             , '''' PRO_NO_ID_UEF
             , PRO_VOIE_C CodeRue
             ,''1'' pr
             ,  '''' AS service_description
             , ''1900-01-01'' AS date_of_service_call
         FROM HYSEC_DELTA..PROSPECT p
             INNER JOIN HYSEC_DELTA..PROSPECT_CIVIC pc ON p.PRO_NO_ID_UEF= pc.PRO_NO_ID_UEF
             INNER JOIN hysec_delta..MUNICIPALITE mun ON mun.mun_no_bsq= p.PRO_BSQ
  where 1=1
   and REPLACE(pc.CIVIC, '','', '''') = ''7100 ''
   and ISNULL(NULLIF('' '' + pro_voie_l, '' ''), '''') + ISNULL(NULLIF('' '' + PRO_VOIE, '' ''), '''')  + ISNULL(NULLIF('' '' + PRO_VOIE_O, '' ''), '''')  like ''%JEANTALON%''
 ORDER BY NomRue',@p3 output,@p4 output,@p5 output
exec sp_cursoropen @p1 output,N'
   select distinct top 450 g.CUSTNMBR,g.ADRSCODE,Raison_Retenue STATUT,isnull(Contract_Internal_Name,'''')Produit, a.Civic, UPPER(isnull(APP,'''')) APP,Rue NomRue,isnull(Nom_Ville,'''') NomMunicipalite,a.ZIP CodePostal,isnull(a.PRO_NO_ID_UEF,'''')PRO_NO_ID_UEF,'''' CodeRue,''2''pr, isnull(service_description, '''') as service_description, isnull(date_of_service_call, ''1900-01-01'') as date_of_service_call from HYSEC_DELTA..HS_ADRESSE a  WITH(NOLOCK)
   left join GMP_VILLE v  WITH(NOLOCK)
   on a.City=v.ID_VILLE
  inner join HS_Client g  WITH(NOLOCK)
  on a.CUSTNMBR = g.CUSTNMBR
    and a.ADRSCODE = g.ADRSCODE
  left join HS_Produit p  WITH(NOLOCK)
  on a.CUSTNMBR = p.CUSTNMBR
    and a.ADRSCODE = p.ADRSCODE
    and WS_Closed = 0
    and Service_User_Define_10<getdate()
    and Service_User_Define_18=1
   left join HYSEC_DELTA..PROSPECT_CIVIC b  WITH(NOLOCK)
    on a.Civic = b.CIVIC
    left join HYSEC_DELTA..PROSPECT c  WITH(NOLOCK)
   on b.PRO_NO_ID_UEF =  c.PRO_NO_ID_UEF
   and replace(a.Zip,'' '','''') = c.PRO_POSTAL
   and a.RUE = c.PRO_VOIE
   left join (select service_description, date_of_service_call, custnmbr, adrscode from hs_appel where (service_description = ''remplacement'' or service_description =  ''Nouvelle installation''
   and  Resolution_Description = '''')  ) as  appel on appel.custnmbr = g.custnmbr and appel.adrscode = g.adrscode
   where  1=1
   and  g.ADRSCODE = ''SERVICE''
   and REPLACE(REPLACE(a.Civic, '','', ''''), CASE WHEN ISNUMERIC(APP) = 0 THEN  UPPER(isnull(APP,'''')) ELSE '''' END, '''') =''7100''
   and a.Rue like ''%JEANTALON%''',@p3 output,@p4 output,@p5 output
